import React, { useEffect, useState } from 'react'
import {collection, onSnapdhot, onSnapshot, orderBy, query} from "firebase/firestore";
import {db} from "./firebase"

export default function Result() {
    const [post, setPost] = useState([])

    useEffect(()=>{
        const collectionRef = collection(db,"upload");
        const quer = query(collectionRef,orderBy("timestamp", "desc"))
        const unsubscribe = onSnapshot(quer, (querySnapshot)=>{
            setPost(querySnapshot.docs.map(doc =>({...doc.data(), id: doc.id, timestamp: doc.data().timestamp?.toDate()})))
        })
        return unsubscribe
    } , [])

  return (
    <div>{

        post.map(post =>{
            <div key={post.id}>
                <div>{post.caption}</div>
                </div>

        })
        
        
        }</div>
  )
}
